import React from "react";
import Navbar from "../halaman1/navbar/navbar"
import "../profil/profil.css";
import logoprofil from '../halaman1/navbar/logo1.png';




function Profil() {
    return (
      <>
        <Navbar />
        
        <div className="container" id="profil">
            <div className="row" id="profil1">
                <div className="col-md-6 m-auto text-center">
                <h1 className="display-4">Profil</h1>
                </div>
            </div>
        </div>

        <div className="container-fluid text-center mt-5">
            <div className="row">
                <div className="col">
                
                <img src= { logoprofil } className="img-thumbnail"></img>

                </div>
                <div className="col">
                2 of 2
                </div>
            </div>
        </div>

      </>
   );
  }

  export default Profil;
